import { useState } from 'react';

function Hello() {
    return (
        <>
            <h1>Hello</h1>
        </>
    );
}

function App() {
    const [showing, setShowing] = useState(false);
    const onClick = () => {
        setShowing((prev) => !prev);
    };
    return (
        <div>
            <button onClick={onClick}>{showing ? 'Hide' : 'Show'}</button>
        </div>
    );
}

export default App;
